UPDATE et
    SET "IsRelatedToRules" = CASE WHEN r."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN 
(
    SELECT "id", "entitytype_id" FROM "up_singleroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
    UNION
    SELECT "id", "entitytype_id" FROM "up_compositeroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
    UNION
    SELECT "id", "sourceentitytype_id" as "entitytype_id" FROM "up_resourcetypes" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
) r ON r."entitytype_id" = et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToRoleReview" = CASE WHEN r."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN 
(
    SELECT "id", "entitytype_id" FROM "up_singleroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121) AND "approvalworkflowtype" != 0 
    UNION
    SELECT "id", "entitytype_id" FROM "up_compositeroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121) AND "approvalworkflowtype" != 0
) r ON r."entitytype_id" = et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToRoleReconciliation" = CASE WHEN r."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN 
(
    SELECT "id", "entitytype_id" FROM "up_singleroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
    UNION
    SELECT "id", "entitytype_id" FROM "up_compositeroles" WHERE "validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
) r ON r."entitytype_id" = et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToResourceReview" = CASE WHEN rt."id" IS NULL THEN 0 ELSE 1 END,
        "IsRelatedToResourceReconciliation" = CASE WHEN rt."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN "up_resourcetypes" rt ON rt."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121) AND rt."sourceentitytype_id" = et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToManualProvisioning" = CASE WHEN rt."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN 
(
    SELECT DISTINCT rt."id", rt."sourceentitytype_id", rt."validto"
    FROM "up_resourcetypes" rt
    JOIN "uc_entitytypemappings" tet ON tet."id" = rt."targetentitytype_id" 
    JOIN "uc_connectors" tc ON tc."id" = tet."connector_id" 
    LEFT JOIN "uc_resourcetypemappings" rtm ON rtm."id"=rt."id"
    WHERE(rtm."fulfillmenttype" = 2 OR tc."fulfillmenttype" = 2)
) rt on rt."sourceentitytype_id" = et."id" AND rt."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToWorkflowReview" = CASE WHEN w."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN 
(
    SELECT DISTINCT w."id", w."variablestype_id"
    FROM "uw_workflows" w
    JOIN "uw_activities" a1 ON a1."workflow_id"=w."id"
    JOIN "uw_activitytemplates" at1 ON at1."id"=a1."template_id" 
    JOIN "uw_activitytemplatestates" ats1 ON ats1."activitytemplate_id"=a1."template_id" 
    JOIN "uw_activities" a ON a."workflow_id"=w."id" 
    JOIN "uw_activitytemplates" att ON att."id"=a."template_id" 
    JOIN "uw_activitytemplatestates" ats ON ats."activitytemplate_id"=a."template_id" 
    WHERE((a1."order"<a."order") OR(a1."order"=a."order" AND ats1."id"!=ats."id" AND att."firststate_id"!=ats."id")) AND ats."interactive"=1 
) w ON  w."variablestype_id"=et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToWorkflowSupervision" = CASE WHEN w."id" IS NULL THEN 0 ELSE 1 END
FROM "um_entitytypes" et
LEFT JOIN "uw_workflows" w ON w."variablestype_id"=et."id"
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
    SET "IsRelatedToAccessCertificationCampaign" = CASE WHEN et."id">=(4294967295/2) THEN 0 ELSE 1 END
FROM "um_entitytypes" et
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
GO

UPDATE et
