LEFT JOIN "up_risks" r ON r."entitytype_id"=et."id" AND r."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
WHERE et."validto"=CONVERT(DATETIME2(2),'9999-12-31 23:59:59.999',121)
